import React, { Component, Fragment } from "react";
import "./index.css";
import Controls from "../../components/Control";
import Main from "../../components/Main";

const Game = () => {
  return (
    <Fragment> {/* Fragment chức năng giống thẻ <></> là thẻ rỗng, ko render trên giao diện */}
      <Controls />
      <Main />
    </Fragment>
  );
};

export default Game;
